  // FETCH
  eventList = [
    {
      city: 'Berlin',
      date: '10.10.2020',
      live: 'https://flaviocopes.com/nextjs-active-link/',
      register: 'https://flaviocopes.com/nextjs-active-link/',
    },
    {
      city: 'Hamburg',
      date: '10.10.2020',
      live: 'https://flaviocopes.com/nextjs-active-link/',
